import {useState} from 'react'
import Header from "../../components/memo/Header";

function Memo() {

const [number , setNumber] = useState(0);

const data = {name:"Hüseyin"};

  return (
    <div>
        <Header number={number} data ={data}/>
        <hr />
        <h1>{number}</h1>
        <button onClick={()=>(setNumber(number + 1))}>Click</button>
    </div>
  )
} 

export default Memo
